import './App.css';
import Row from "./Row";
import request from './request';

function App() {
  return (
    <div className="App">
      <h1>Netflix React</h1>
      <Row title="Netflix Originals" fetchUrl={request.fetchTrending}/>
      <Row title="Trending Now" fetchUrl={request.fetchNetflixOriginal}/>
      <Row title="Top Rated" fetchUrl={request.fetchTopRated}/>
    </div>
  );
}

export default App;
